import logo from './logo.svg';
import './App.css';
import Facultylogin from './components/Facultylogin';
import Facultyregistartion from './components/Facultyregistartion'; 
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import Forgetpassword from './components/Forgetpassword'; 
import StudentRegistartion from './components/StudentRegistration';
import FacultyDashboard from './components/FacultyDashboard';
import { useState } from 'react';

function App() {
  const [show, setShow] = useState(true)

    if(show){
      return(
  <BrowserRouter><Routes>
    <Route path="/" element={<Facultyregistartion />}/>
    <Route path ="/login" element={<Facultylogin  />} /> 
    <Route path ="/add-student" element={<StudentRegistartion />} /> 
    <Route path="/facultydashboard" element={<FacultyDashboard />}/>
    </Routes>
    </BrowserRouter>
      )
    }
    else{
      return(
        <BrowserRouter>
        <FacultyDashboard>
          <Routes>
            <Route path="/FacultyHeader" />
            <Route/>
          </Routes>
        </FacultyDashboard>
        </BrowserRouter>
      )
    }
}

export default App;
